const App = () => {
  return (
    <div className='app'>
      <section className='side-bar'>
        <button>+ New chat</button>
        <nav>
          <p className='history'>Made by KST</p>
        </nav>
      </section>
      <section className='main'></section>
    </div>
  );
};

export default App;
